                               type="search" placeholder="First Name"
                               aria-label="Search"

                        />
                        <input id="firstname" className="form-control mr-sm-2"
                               type="search" placeholder="First Name"
                               aria-label="Search"

                        />
                        <Link to='/'>
                            <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Register
                            </button>
                        </Link>
                    </form>
                </div>
            </div>
        );
    }
}
export default Register;
